import React, { FC } from 'react';

import styles from './main.module.scss';

interface MainProps {}

const Main: FC<MainProps> = () => {

  const getPar = () => {
    const date = new Date(), y = date.getFullYear(), m = date.getMonth();
    const firstDay = new Date(y, m, 1);
    const today = date.getUTCDay();
    console.log(today);
    if(firstDay) return alert('תמיר אלמקייס');
  }
  return(
  <main className={styles.Main}>
    <div className='iframeDiv'>
    <p onClick={getPar}>Sale !</p>
    <iframe width="560" height="315" src="https://www.youtube.com/embed/XKVPu3i_3-8" title="YouTube video player" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share"></iframe>
    </div>
  </main>
);
}

export default Main;
